import Head from 'next/head'
import React from 'react'
import { connect } from 'react-redux'
import BlogPost from '../../components/blog/BlogPost'
import Layout from '../../components/Layout'

const blogs=[
    {    
        id: 1,
        date: '05/15/20',
        title: 'Unilous is launched',
        image: 'https://bit.ly/2UEIR2d',
        link: 'https://unilous.com',
        author: 'Unilous contributors',
        description: 'Today is the day we launch Unilous. We are seeking users to join our team-building platform.',
    },
    {
        id: 2,
        date: null,
        title: '2nd blog title',
        image: 'https://bit.ly/2YBN5sC',
        link: '',
        author: 'Seneca',
        description: 'Some sentences.', 
    }
]

const BlogIndex = () => {
    return (
        <Layout>
            <Head>
                <title>Blog | Unilous</title>
                <meta name="description" content="Contact the Unilous team" key="description"/>
            </Head>
            <div className="navbar-height" />
                {blogs.map(item => 
                    <BlogPost 
                        key={item.id} 
                        title={item.title} 
                        description={item.description}
                        link={item.link}
                        image={item.image}
                        author={item.author}
                    />
                )}
        </Layout>
    )
}

const mapStateToProps = (state) => {
	return {
        // currentUser: state.currentUser,
	}
}

const mapDispatchToProps = (dispatch) => {
    return {
        // setUserDD: bindActionCreators(setUserDD, dispatch),
    }
}

export default connect(
    mapStateToProps,
    mapDispatchToProps
)(BlogIndex)
